const year = []
const month = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December']

for (var i = 0; i < 22; i++) {
  let currentYear = (2000 + i).toString()
  year.push(currentYear)
}

module.exports = { year, month }
